  greet="GOOD MORNING";
 obj={
    color:"green",
 }
}
else if(date.getHours()>=12 && date.getHours()<=19){
 greet="GOOD AFTERNOON";
 obj={
  color:"y",
}
}
else{
 greet="GOOD NIGHT";
 obj={
  color:"black",
}
}
root.render(<>
  <div className='whether'>
  <h1>HELLO SIR,{greet}</h1>
